Sveiki,

Pastaruoju metu Minties g. 32 ir giliau esančių namų gyventojai pradėjo ypatingai netvarkingai statyti automobilius. Tiek rytais, tiek vakarais būna apstatinėti šaligatviai ir pavojinga praeiti tiek suaugusiems, tiek vaikams, nors Minties g. pakėlės būna apytuštės ir galėtų statyti ten.

Tokia situacija yra pavojinga, nes:
-Pavojinga apeidinėti ant šaligatvių stovinčius automobilius (ypač vaikams), kai keliu vyksta eismas;
-Apstatinėti šaligatviai neleidžia nuo jų nuvalyti sniego, nes netelpa valanti technika;
-Neina saugiai išvažiuoti/įvažiuoti į kiemą, kas kelia pavojų apgadinti kitus automobilius. Kartais būna, kad niekaip neina pravažiuoti ir reikia gadinti automobilį važiuojant per aukštus bortus;
-Nelaimės atveju negalėtų atvykti nei greitoji pagalba nei priešgaisrinė gelbėjimo tarnyba.

Prašau viešosios tvarkos skyriaus darbuotojų kurį laiką skirti daugiau dėmesio Minties g. 32 ir giliau esančių namų kiemams, atliekant patikrinimus tiek rytais, tiek vakarais.

